package bean;

public class trangchubean {
	public String maxe;
	public String tenxe;
	public long soluong;
	public long gia;
	public String anh;
	public String ngaynhap;
	public String mahangxe;
	public String tenhangxe;
	public String anhhangxe;
	public trangchubean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public trangchubean(String maxe, String tenxe, long soluong, long gia, String anh, String ngaynhap, String mahangxe,
			String tenhangxe, String anhhangxe) {
		super();
		this.maxe = maxe;
		this.tenxe = tenxe;
		this.soluong = soluong;
		this.gia = gia;
		this.anh = anh;
		this.ngaynhap = ngaynhap;
		this.mahangxe = mahangxe;
		this.tenhangxe = tenhangxe;
		this.anhhangxe = anhhangxe;
	}
	public String getMaxe() {
		return maxe;
	}
	public void setMaxe(String maxe) {
		this.maxe = maxe;
	}
	public String getTenxe() {
		return tenxe;
	}
	public void setTenxe(String tenxe) {
		this.tenxe = tenxe;
	}
	public long getSoluong() {
		return soluong;
	}
	public void setSoluong(long soluong) {
		this.soluong = soluong;
	}
	public long getGia() {
		return gia;
	}
	public void setGia(long gia) {
		this.gia = gia;
	}
	public String getAnh() {
		return anh;
	}
	public void setAnh(String anh) {
		this.anh = anh;
	}
	public String getNgaynhap() {
		return ngaynhap;
	}
	public void setNgaynhap(String ngaynhap) {
		this.ngaynhap = ngaynhap;
	}
	public String getMahangxe() {
		return mahangxe;
	}
	public void setMahangxe(String mahangxe) {
		this.mahangxe = mahangxe;
	}
	public String getTenhangxe() {
		return tenhangxe;
	}
	public void setTenhangxe(String tenhangxe) {
		this.tenhangxe = tenhangxe;
	}
	public String getAnhhangxe() {
		return anhhangxe;
	}
	public void setAnhhangxe(String anhhangxe) {
		this.anhhangxe = anhhangxe;
	}
		
}
